import time
import os
from selenium import webdriver
from selenium.webdriver.common.by import By
from selenium.webdriver.support.ui import WebDriverWait
from selenium.webdriver.support import expected_conditions as EC
from selenium.webdriver.chrome.options import Options
from selenium.webdriver.chrome.service import Service

from loguru import logger

def wait_for_download_to_complete(download_dir, predownload_files, timeout=30, poll_interval=0.5):
    """
    Wait for a download to complete by polling the download directory.
    
    Args:
        download_dir: Directory where files are downloaded
        predownload_files: List of files in the directory before download
        timeout: Maximum time to wait in seconds
        poll_interval: Time between checks in seconds
        
    Returns:
        str or None: The name of the new file, or None if no file was downloaded
    """
    start_time = time.time()
    
    while time.time() - start_time < timeout:
        # Get current files in download directory
        current_files = set(os.listdir(download_dir))
        pre_files = set(predownload_files)
        
        # Check if any new files appeared
        if current_files != pre_files:
            new_files = [f for f in current_files if f not in pre_files]
            
            # Filter for SVG files
            svg_files = [f for f in new_files if f.endswith('.svg')]
            if svg_files:
                return svg_files[0]
            
            # If there are new files but none are SVG, check for partial downloads
            temp_files = [f for f in new_files if f.endswith('.tmp') or f.endswith('.crdownload')]
            if not temp_files:
                # No temp files and no SVG files - return the first new file
                return new_files[0] if new_files else None
        
        # Sleep for the poll interval
        time.sleep(poll_interval)
    
    # Timeout reached
    return None

def export_mitre_attack_svg(url: str):
    """
    Automates the process of exporting an SVG from the MITRE ATT&CK Navigator:
    1. Opens the website
    2. Creates a new Enterprise ATT&CK layer
    3. Clicks on export -> render layer as svg
    4. In the popup, clicks on display settings
    5. Unchecks the "show header" checkbox
    6. Downloads the SVG
    """
    logger.debug("SVG FUNCTION START")
    # Setup Chrome options
    chrome_options = Options()
    service = Service("/usr/bin/chromedriver")
    
    logger.debug("YAY - SERVICE")
    
    # Create downloads directory if it doesn't exist
    download_dir = os.path.join(os.getcwd(), "downloads")
    if not os.path.exists(download_dir):
        os.makedirs(download_dir)
    
    # Configure Chrome to download files automatically without prompting
    chrome_options.add_experimental_option("prefs", {
        "download.default_directory": download_dir,
        "download.prompt_for_download": False,
        "download.directory_upgrade": True,
        "safebrowsing.enabled": False
    })
    
    # Uncomment the line below if you want to run headless
    chrome_options.add_argument("--headless")
    #chrome_options.add_argument("--window-size=1920,1080")
    
    # Initialize WebDriver - use system's ChromeDriver directly
    driver = webdriver.Chrome(service=service,options=chrome_options)
    
    try:
        # Open the website
        driver.get(url)
        print("Website opened")
        
        # Wait for the page to load and click on Create New Layer
        wait = WebDriverWait(driver, 30)
        
        # Using the exact element selector for "Create New Layer" panel header
        # create_layer_button = wait.until(EC.element_to_be_clickable(
        #     (By.CSS_SELECTOR, "mat-expansion-panel-header.mat-expansion-panel-header")
        # ))
        # create_layer_button.click()
        # print("Clicked on Create New Layer panel")
        
        # # Click on Enterprise ATT&CK option (clicking the button that contains the text)
        # enterprise_attack_option = wait.until(EC.element_to_be_clickable(
        #     (By.XPATH, "//button[contains(.,'Enterprise ATT&CK')]")
        # ))
        # enterprise_attack_option.click()
        # print("Clicked on Enterprise ATT&CK")
        
        # Wait for the layer to load and Layer Controls to be visible
        layer_controls = wait.until(EC.element_to_be_clickable(
            (By.XPATH, "//div[contains(@class,'section-label') and text()=' Layer Controls ']")
        ))
        print("Layer loaded")

        layer_controls.click()
        
        # Click on the export button (file_download icon)
        export_button = wait.until(EC.element_to_be_clickable(
            (By.XPATH, "//div[@mattooltip='export']")
        ))
        export_button.click()
        print("Clicked on Export")
        
        # Click on "Render Layer as SVG" option
        render_svg_option = wait.until(EC.element_to_be_clickable(
            (By.XPATH, "//div[@mattooltip='render layer to SVG']")
        ))
        render_svg_option.click()
        print("Clicked on Render Layer as SVG")
        
        # Wait for the popup to appear and click on display settings
        display_settings_button = wait.until(EC.element_to_be_clickable(
            (By.XPATH, "//div[@mattooltip='display settings']")
        ))
        display_settings_button.click()
        print("Clicked on display settings")
        
        # Uncheck "show header" checkbox
        show_header_checkbox = wait.until(EC.element_to_be_clickable(
            (By.XPATH, "//label[@for='undefinedcheckboxheader']")
        ))
        show_header_checkbox.click()
        print("Unchecked 'show header' checkbox")
        
        # Click on download SVG button
        download_button = wait.until(EC.element_to_be_clickable(
            (By.ID, "download-buttonvm0")
        ))

        time.sleep(2)

        # Get list of files before download
        predownload_files = os.listdir(download_dir)

        # Click download button
        download_button.click()
        print("Clicked on download SVG")
        
        # Wait for download to complete with polling approach
        print("Waiting for download to complete...")
        new_file = wait_for_download_to_complete(download_dir, predownload_files)
        
        # Check if download was successful
        if new_file:
            print(f"Download completed. File downloaded: {new_file}")
        else:
            print("Warning: No new files downloaded!")
        
    except Exception as e:
        print(f"An error occurred: {e}")
    
    finally:
        # Close the browser
        driver.quit()
        print("Browser closed")
        
if __name__ == "__main__":
    export_mitre_attack_svg("https://mitre-attack.github.io/attack-navigator/#layerURL=data%3Aapplication%2Fjson;base64,&t=1745962492")